package dist.esper.experiment2;

public class NodesParameter {
	int	numWay;
	int nodeCount;
	double equalRatio;
	double implyRatio;
	
	public NodesParameter(int numWay, int nodeCount, double equalRatio, double implyRatio) {
		super();
		this.numWay = numWay;
		this.nodeCount = nodeCount;
		this.equalRatio = equalRatio;
		this.implyRatio = implyRatio;
	}
}
